import React from 'react';
import { Box, Grommet, Heading, Keyboard } from 'grommet';

function App() {
  return (
    <Grommet plain>
      yeet
      <Keyboard target="document" onEsc={() => console.log('Console opened')}>
        <Box pad="large" background="light-4">
          <Heading level="3">Press Esc on me!</Heading>
        </Box>
      </Keyboard>
    </Grommet>
  );
}

export default App;
